    <div className=''>
      <motion.h1         
      initial="offscreen"
      whileInView="onscreen"
      viewport={{ once: true, amount: 0.8 }}
      className='titleLearn'>How it works</motion.h1>
    </div>
  );
}

export default PageLearn;
